import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter, Route} from 'react-router-dom'
import Login from './Routes/Login'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route exact path="/login" component={Login}/>


      </BrowserRouter>
      
    </div>
  );
}

export default App;
